Wanneer Koens huwelijk met Magda uiteen dreigt te vallen, beslist hij om zijn eigen fatsoensgrenzen tot het uiterste te testen. Samen ontdekken ze haar verborgen verlangens. Nooit had Koen gedacht dat SM tot een gelukkig huwelijk zou kunnen leiden. Maar wanneer gaandeweg Magda verder gaat, en extremere vormen van genotsbeleving opzoekt, raakt het koppel verstrikt in een web van pooiers, klikkende rijkswachters en afgunstige collega's.



